getElem("filter_channel_only").checked=JSON.parse(localStorage.colorChannel);getElem("filter_highlight_friends").checked=JSON.parse(localStorage.highlightFriends);getElem("filter_attempt").style.paddingTop="20px";getElem("filter_attempt").parentNode.style.width="50%";getElem("filter_attempt").parentNode.style.cssFloat="left";getElem("filter_attempt").parentNode.childNodes[1].style.position="absolute";getElem("filters_form").style.width="328px";Mods.Chatmd.game_tips={0:"In defensive fight mode, each point of damage you deal will give 2 xp to the defense skill and 1 xp to health.;In accurate fight mode, each point of damage you deal will give 2 xp to the accuracy skill and 1 xp to health.;In aggressive fight mode, each point of damage you deal will give 2 xp to the strength skill and 1 xp to health.;In controlled fight mode, combat xp is equally divided between strength, defense and accuracy. Health will always get 1 xp per damage dealt.;Ingame wiki mod is a precious resource to plan your adventure. Access it typing /wiki in the chat line.;You can turn tips off from the Game Options menu.;If you like RPG MO, consider writing a review and gaining free MOS: http://forums.mo.ee/viewtopic.php?t=3870.;There is a Secret Cow Level.;The Enhanced Map mod adds several details to the game map, including key resource spots, travel points and boss locations.;The Enhanced Market mod adds several helpers for player's market operations, including the ability to resubmit expired offers and compare your equip with the one that is for sale.;Your health slowly regenerates over time: you gain 1 health every minute.;The more health a mob has, the more time it takes to respawn.;Be ready to be hunted down and fight for your life if you go into No Man's Land, the RPG MO PvP area.;Don't sell raw fish you get, cook it!;Better boots can increase your movement speed.;Food heals you. You can get food by killing chickens or by fishing. You may have to cook the food.;The forums have a lot of information about this game. You can access them on http://forums.mo.ee/ .;Are you lost? Access zone maps and much more on RPG MO Atlas: http://tinyurl.com/rpgmoatlas;If you die, you will lose all the items you are carrying but the two most valuable. Beware!;Potion of Preservation is a special potion that must be equipped and it will be consumed on death, allowing you to save a total of 7 items from your inventory.;If you have a pet equipped and you die you keep the pet. If it is not equipped, but it's in your inventory you may lose it.;When you die you do not lose the items you placed in your pet's inventory.;You can buy an island deed from the farmer in Dorpat.;To see your combat level, mouse over yourself. To see the level of monsters, position the mouse pointer over them.;Public chat is global, meaning everyone online can read it!;Players chat is white, moderators chat is green and developers/admins chat is orange.;To whisper, type /w \"[playersname]\" followed by the message.;Type /online to bring up a list of players currently online.;Type /played to see how much time has passed since your first login.;Type /penalty to view or spend your current penalty points.;Type /wiki to access the ingame wiki database.;Enable the Enhanced Market mod to gain access to the Trade Channel ($$).;Type /xp to check the duration of an ongoing x2 Experience event.;x2 Experience server events are triggered by players using special x2 pots from the MOS market.;Need help? Don't be afraid to ask! RPG MO is full of helpful players! Further help and guides can be found in the game forums.;Higher accuracy will allow you to equip better weapons.;Higher defense will allow you to equip better armor.;Higher health will allow you to equip better jewelry.;Do not ignore Captchas! If you fail or ignore them you will get -5 penalty points and you will go to jail.;If you end up in jail, only a Game Moderator or an Admin can decide to free you.;You can save up to 5 captcha points. Using Captcha points will add XP to a skill of your choice.;You can access the player's market through the chest.;Some pets can be purchased from the pet vendor in Dorpat. Better pets are usually available on the market ;A pet can extend your inventory space by 4, 8, 12 or 16 slots. Pets also give stats boosts.;Cross-chatting is bad. If someone is speaking in a chat channel, make sure you answer in the same one.;The best way to make money is through gathering professions (especially mining). There will always be players looking for iron, sand or coal in the player's market!;Through the market you can place \"buy\" or \"sell\" offers, and you can check buy and sell offers from other players.;MOS is a special currency that can be acquired with real money. It allows you to buy special items from the MOS store.;The MOS Store is accessible from the \"Buy items and coins\" link at the bottom right of page.;To use magic you need to buy and equip a magic pouch, fill it with spell scrolls (all available at Dorpat Magician NPC) and engage in combat.;You are allowed to have a max of 5 accounts (alts), but trading items or materials between your own accounts is not allowed.;Please check RPG MO Code of Conduct on http://forums.mo.ee/viewtopic.php?t=3083".split(";")};
